typedef struct perf_test_results_s {
    unsigned long count;
    unsigned long verified_count;
    uint64_t total_execution_ms;
    float single_execution_ms;
    float throughput;	// MB/s
} perf_test_results_t;

typedef struct hash_args_s {
    const char *name;
    const uint8_t *data;
    int size;
    const uint8_t *expected;
} hash_args_t;

#if !defined(MBEDTLS_USE_PSA_CRYPTO)

enum {
    DO_SHA256 = 0,
    DO_SHA224 = 1
};

#endif  /* MBEDTLS_USE_PSA_CRYPTO */

static int do_sha256(const void *a) {

    if (!a) return -1;

    const hash_args_t *args = (const hash_args_t *)a;

    uint8_t result[SHA256_SIZE_BYTES];

#if defined(MBEDTLS_USE_PSA_CRYPTO)

    size_t hash_length = 0;

    psa_status_t res = psa_hash_compute( PSA_ALG_SHA_256,
            args->data, args->size, result, sizeof(result), &hash_length);
    if (res != PSA_SUCCESS || hash_length != sizeof(result)) return -1;

#else

#if 0
    mbedtls_sha256_context sha256;

    mbedtls_sha256_init(&sha256);
    int ret = mbedtls_sha256_starts( &sha256, DO_SHA256);
    if (ret != 0) return ret;

    ret = mbedtls_sha256_update(&sha256, args->data, args->size);
    if (ret != 0) return ret;

    ret = mbedtls_sha256_finish(&sha256, result);
#else
    ret = mbedtls_sha256( args->data, args->size, result, DO_SHA256 );
#endif
    if (ret != 0) return ret;

#endif  /* MBEDTLS_USE_PSA_CRYPTO */

    return memcmp(result, args->expected, SHA256_SIZE_BYTES);
}

#if defined(_WIN32)

static unsigned long millis(void) {

    static LARGE_INTEGER freq;
    static int have_freq = 0;

    if (!have_freq) {
        QueryPerformanceFrequency(&freq);
        have_freq = 1;
    }

    LARGE_INTEGER t;
    QueryPerformanceCounter(&t);
    // t.QuadPart is the number of ticks: divide by freq to get seconds
    // We want ms, so multiply by 1000 first
    t.QuadPart *= 1000;
    return (unsigned long)(t.QuadPart / freq.QuadPart);
}

#else

static unsigned long millis(void) {
#ifndef CLOCK_MONOTONIC
#error need CLOCK_MONOTONIC
#endif

#ifdef MONOTONIC_CLOCK
#error oops
#endif

#ifdef CLOCK_MONOTONIC_RAW
#define MONOTONIC_CLOCK CLOCK_MONOTONIC_RAW
#else
#define MONOTONIC_CLOCK CLOCK_MONOTONIC
#endif

    struct timespec ts;

    int ret = clock_gettime(MONOTONIC_CLOCK, &ts);

    if (ret != 0) return 0L;

    return ts.tv_sec * 1000 + ts.tv_nsec / 1000000;
}

#endif /* _WIN32 */

static int run_perf_test(int (*fn)(const void *), const void *param, size_t kbytes, perf_test_results_t *res) {

    if (!fn) return -1;

    unsigned int count = 1;
    uint64_t elapsed = 0;

    for (int loop = 0; loop < 10; loop++) {	// in case weird timing things happen

        res->verified_count = 0;

        uint64_t t0 = millis();

        for (unsigned int i = 0; i < count; i++) {
            int ret = fn(param);
            if (ret != 0) return ret;
            res->verified_count++;
        }

        uint64_t t1 = millis();

        elapsed = t1 - t0;
        if (elapsed <= 10) {
            count *= 10;
            continue;
        } else if (elapsed < 350) {
            count *= 10;
            continue;
        } else if (elapsed < 1300) {
            count *= 3000;
            count /= elapsed;
            continue;
        }

        break;
    }

    res->count = count;
    res->total_execution_ms = elapsed;
    res->single_execution_ms = (float)elapsed / count;
    res->throughput = (float)kbytes * count / elapsed;	// in MB/s, as elapsed is in ms

    return 0;
}

