static void verify(void) {

    uint32_t ok = 0;

    uint64_t t0 = millis();

    for (size_t i = 0; i < NITEMS(test_vectors); i++) {

        test_vector_t *t = &test_vectors[i];

        uint8_t result[SHA256_SIZE_BYTES];

        mbedtls_sha256_context sha256;

        uint32_t dataLen = t->dataLen;
        const uint8_t *data = t->data;

        for (uint32_t split = 0; split <= dataLen; split++) {

            memset(result, 0, sizeof(result));

            mbedtls_sha256_init(&sha256);
            int ret = mbedtls_sha256_starts( &sha256, DO_SHA256);
            if (ret != 0) {
                fprintf(stderr, "verify: %luS%u: SHA256_INIT() -> %d\n", i, split, ret);
                exit(1);
            }

            ret = mbedtls_sha256_update(&sha256, data, split);
            if (ret != 0) {
                fprintf(stderr, "verify: %luS%u-1: SHA256_UPDATE() -> %d\n", i, split, ret);
                exit(1);
            }

            ret = mbedtls_sha256_update(&sha256, data + split, dataLen - split);
            if (ret != 0) {
                fprintf(stderr, "verify: %luS%u-2: SHA256_UPDATE() -> %d\n", i, split, ret);
                exit(1);
            }

            ret = mbedtls_sha256_finish(&sha256, result);
            if (ret != 0) {
                fprintf(stderr, "verify: %luS%u: SHA256_FINAL() -> %d\n", i, split, ret);
                exit(1);
            }

            ret = memcmp(result, t->expected, sizeof(result));
            if (ret != 0) {
                fprintf(stderr, "verify: %luS%u (%u): memcmp() -> %d\n", i, split, dataLen, ret);
                exit(1);
            }

            ok++;
        }
    }

    uint64_t t1 = millis();

    printf("%d verifications using %lu test vectors in %lu ms\n", ok, NITEMS(test_vectors), (unsigned long)(t1 - t0));
}

#endif  // DO_VERIFY

int main( int argc, char *argv[] )
{
    (void) argc;

#ifdef DO_VERIFY
    verify();
#endif

    size_t maxSize = 0;

    for (size_t s = 0; s < TEST_CASE_COUNT; s++) {
        size_t size = sizes[s];
        if (size > maxSize) maxSize = size;
    }

    uint8_t *data = malloc(maxSize);
    if (!data) {
        fprintf(stderr, "%s: unable to allocate %lu bytes\n", argv[0], (unsigned long)maxSize);
        mbedtls_exit(MBEDTLS_EXIT_FAILURE);
    }

    uint8_t *p = data;
    for (size_t filled = 0; filled < maxSize; filled += sizeof(random256)) {
        memcpy(p, random256, sizeof(random256));
        p += sizeof(random256);
    }

    for (size_t c = 0; c < TEST_CASE_COUNT; c++) {

        perf_test_results_t results = { 0 };

        hash_args_t args = { "SHA-256", data, sizes[c], sha256_expected[c] };
        int ret = run_perf_test(do_sha256, &args, sizes[c] / 1024, &results);
        if (ret != 0 || results.verified_count != results.count) {
            fprintf(stderr, "%s: FAILURE ret = %d, results.verified_count = %lu, results.count = %lu\n", argv[0], ret, results.verified_count, results.count);
            mbedtls_exit(MBEDTLS_EXIT_FAILURE);
        }

        printf("%s: %lu KB x %lu in %lu ms -> %.1f ms per execution, %.1f Mb/s\n",
               args.name,
               (unsigned long)(sizes[c] / 1024), results.count, (unsigned long)results.total_execution_ms, results.single_execution_ms, results.throughput);
    }

    free(data);

#if defined(_WIN32)
    mbedtls_printf( "  Press Enter to exit this program.\n" );
    fflush( stdout );
    getchar();
#endif

    mbedtls_exit( MBEDTLS_EXIT_SUCCESS );
}
#endif /* MBEDTLS_SHA256_C */
